import React, { Component } from 'react'
import { Button, Container, FlexContainer, InputSearch } from './Todo'

export default class extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: []
    }
  }

  render() {
    return (
      <Container>
        <FlexContainer>

        </FlexContainer>
        <InputSearch type={'text'} placeholder={'Search'} />
        <Button> + New User  </Button>
      </Container>
    )
  }
}
